import React from 'react';

import img_set from './header_image/setting.png';

class Menu extends React.Component {
    render() {
        return (
            <div>
                <div className="menu_item">
                    <a href="#">Menu</a>
                </div>

                <div className="menu_item">
                    <a href="#">Documents</a>
                </div>

                <div className="menu_item">
                    <a href="#">Search</a>
                </div>

                <div className="menu_item">
                    <a href="#">Messages</a>
                </div>

                <div className="menu_item">
                    <a href="#">Statistics</a>
                </div>

                <div className="menu_item">
                    <img src={img_set} height="15px"/>
                    <a href="#">Settings</a>
                </div>
            </div>
        );
    }
}

export default Menu;
